import React from 'react';
import {Container} from '@material-ui/core';
import styles from './homepage.module.css';
const Homepage = () => {

    return (
        <Container maxWidth='md'>
             <div className={styles.homepage}>
            <h1>Homepage</h1>
            </div>
        </Container>
       
    )
}

export default Homepage;
